I guess lightning does strike twice! Keiran is on his way back to Paris through a flight out of Marseille when his trio runs into the uber sexy Angell Summers (the castle tour guide)! Keiran REALLY wants to stay now but only Manuel can remain! A few minutes in Manu's car was all they needed before they were in the middle of a passionate fuck!
